import React from "react";
import Welcome from "./pages/Welcome";
import Products from "./pages/Products"
import {Route} from "react-router-dom"
import MainHeader from "./components/MainHeader";



function App() {
  return (
    <div>
      <MainHeader/>

      <main>
     <Route path="/welcome">
      <Welcome/>
     </Route>
     <Route path="/products">
      <Products/>
     </Route>
     </main>
    </div>
  );
}

export default App;
